  <meta charset="UTF-8">
  <title>Welcome to Kestros!</title>
  <style>
    html, body {
      height: 100%;
    }

    body.kestros {
      font-family: 'Roboto', 'Helvetica Neue', 'Arial', sans-serif;
      font-weight: 300;
      font-size: 14px;
      color: #808080;
      background-color: #f8f8f8;
    }

    .kestros h1 {
      font-weight: 300;
      color: #808080;
      font-size: 2em;
      margin: 0.4em 0 0.8em;
    }

    .kestros a {
      color: #0077cc;
    }

    .kestros a:visited {
      color: #0077cc;
    }

    .kestros a:hover {
      color: #555555;
      text-decoration: none;
    }

    .kestros .hidden {
      display: none;
    }

    .kestros .grid {
      box-sizing: border-box;
      display: -webkit-flex;
      display: -ms-flexbox;
      display: -webkit-box;
      display: flex;
      -webkit-flex: 0 1 auto;
      -ms-flex: 0 1 auto;
      -webkit-box-flex: 0;
      flex: 0 1 auto;
      -webkit-flex-direction: row;
      -ms-flex-direction: row;
      -webkit-box-orient: horizontal;
      -webkit-box-direction: normal;
      flex-direction: row;
      -webkit-flex-wrap: wrap;
      -ms-flex-wrap: wrap;
      flex-wrap: wrap;
      margin: 0 -8px 0 -8px;
    }

    .kestros .grid.grid-nogutter {
      margin: 0;
    }

    .kestros .grid.grid-nogutter > .col {
      padding: 0;
    }

    .kestros .col {
      box-sizing: border-box;
      -webkit-flex: 0 0 auto;
      -ms-flex: 0 0 auto;
      flex: 0 0 auto;
      -webkit-flex-grow: 1;
      -ms-flex-positive: 1;
      -webkit-box-flex: 1;
      flex-grow: 1;
      -ms-flex-preferred-size: 0;
      -webkit-flex-basis: 0;
      flex-basis: 0;
      max-width: 100%;
      min-width: 0;
      padding: 0 8px 0 8px;
    }

    .kestros .col-align-top {
      -webkit-align-self: flex-start;
      -ms-flex-item-align: start;
      align-self: flex-start;
    }

    .kestros .col-align-bottom {
      align-self: flex-end;
    }

    .kestros .col-align-middle {
      -webkit-align-self: center;
      -ms-flex-item-align: center;
      align-self: center;
    }

    .kestros .col-top {
      justify-content: flex-start !important;
      flex-direction: column;
      display: flex;
    }

    .kestros .col-bottom {
      justify-content: flex-end !important;
      flex-direction: column;
      display: flex;
    }

    .kestros .col-middle {
      justify-content: center;
      flex-direction: column;
      display: flex;
    }

    .kestros .grid-start {
      -webkit-box-pack: start;
      -ms-flex-pack: start;
      justify-content: flex-start;
    }

    .kestros .grid-center {
      -webkit-box-pack: center;
      -ms-flex-pack: center;
      justify-content: center;
    }

    .kestros .grid-end {
      -webkit-box-pack: end;
      -ms-flex-pack: end;
      justify-content: flex-end;
    }

    .kestros .grid-around {
      justify-content: space-around;
    }

    .kestros .grid-between {
      -webkit-box-pack: justify;
      -ms-flex-pack: justify;
      justify-content: space-between;
    }

    .kestros .col-first {
      -webkit-box-ordinal-group: 0;
      -ms-flex-order: -1;
      order: -1;
    }

    .kestros .col-last {
      -webkit-box-ordinal-group: 2;
      -ms-flex-order: 1;
      order: 1;
    }

    .kestros .grid-reverse {

      -webkit-box-direction: reverse;
      -ms-flex-direction: row-reverse;
      flex-direction: row-reverse;
    }

      -ms-flex-preferred-size: 8.33333333%;
      -webkit-flex-basis: 8.33333333%;
      flex-basis: 8.33333333%;
      max-width: 8.33333333%;
    }

    .kestros .col-2 {
      -ms-flex-preferred-size: 16.66666667%;
      -webkit-flex-basis: 16.66666667%;
      flex-basis: 16.66666667%;
      max-width: 16.66666667%;

    .kestros .col-3 {

      -webkit-flex-basis: 25%;
      flex-basis: 25%;
      max-width: 25%;
    }

    .kestros .col-4 {
      -ms-flex-preferred-size: 33.33333333%;
      -webkit-flex-basis: 33.33333333%;
      flex-basis: 33.33333333%;
      max-width: 33.33333333%;
    }

    .kestros .col-5 {

      max-width: 41.66666667%;
    }

    .kestros .col-6 {
      -ms-flex-preferred-size: 50%;
      -webkit-flex-basis: 50%;
      flex-basis: 50%;
      max-width: 50%;
    }

    .kestros .col-7 {
      -ms-flex-preferred-size: 58.33333333%;
      -webkit-flex-basis: 58.33333333%;
      flex-basis: 58.33333333%;
      max-width: 58.33333333%;
    }

    .kestros .col-8 {
      -ms-flex-preferred-size: 66.66666667%;
      -webkit-flex-basis: 66.66666667%;
      flex-basis: 66.66666667%;
      max-width: 66.66666667%;
    }

    .kestros .col-9 {
      -ms-flex-preferred-size: 75%;
      -webkit-flex-basis: 75%;
      flex-basis: 75%;
      max-width: 75%;
    }

    .kestros .col-10 {
      -ms-flex-preferred-size: 83.33333333%;
      -webkit-flex-basis: 83.33333333%;
      flex-basis: 83.33333333%;
      max-width: 83.33333333%;
    }

    .kestros .col-11 {
      -ms-flex-preferred-size: 91.66666667%;
      -webkit-flex-basis: 91.66666667%;
      flex-basis: 91.66666667%;
      max-width: 91.66666667%;
    }

    .kestros .col-12 {
      -ms-flex-preferred-size: 100%;
      -webkit-flex-basis: 100%;
      flex-basis: 100%;
      max-width: 100%;
    }

    @media only screen and (max-width: 480px) {
      .kestros .col-sm {
        flex: 100%;
        max-width: 100%;
      }
    }

    @media only screen and (max-width: 624px) {
      .kestros .col-md {

    @media only screen and (max-width: 744px) {

    .kestros .full-height {
      height: 100%;

      text-align: center;

    .kestros .startup-logo {
      width: 150px;
      padding-top: 24px;
      text-align: center;
